import React from "react";
import { useParams, useHistory } from "react-router-dom";
const Error = () => {
  const { history } = useHistory();
  //   const { fname } = useParams();
  return (
    <>
      <div className="error">
        <h2>Oops this is wrong page!!</h2>
        <button
          onClick={() => {
            history.push();
          }}
        >
          Go Back
        </button>
      </div>
    </>
  );
};

export default Error;
